/* Delete the tables if they already exist */
drop table if exists students;
drop table if exists companies;
drop table if exists offers;

/* Create tables */
CREATE TABLE students (
    id integer NOT NULL,
    first_name text NOT NULL,
    last_name text NOT NULL,
    gender integer NOT NULL,
    dob datetime NOT NULL,
    gpa real NOT NULL,
    gmat integer NOT NULL,
    work_experience integer NOT NULL,
    prior_industry text NOT NULL,
    sponsored_student integer NOT NULL,
    home_country text NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE companies (
    id integer NOT NULL,
    name text NOT NULL,
    industry text NOT NULL,
    number_of_employees integer NOT NULL,
    revenue real NOT NULL,
    headquarters text NOT NULL,
    on_campus_recruiter_2015 integer NOT NULL,
    on_campus_recruiter_2016 integer NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE offers (
    id integer NOT NULL,
    student_id integer NOT NULL,
    company_id integer NOT NULL,
    salary real NOT NULL,
    bonus real NOT NULL,
    equity real NOT NULL,
    offer_issue_date datetime NOT NULL,
    offer_accepted integer NOT NULL,
    PRIMARY KEY (id)
);

